(16,	'TASK-PRTM07062022',	'PR001',	'Belum Memenuhi',	'- R. Tindakan = Sterilisator, tissu kasar, plastik tempat sampah, abocath, ambu bag, pispot, cairan spiritus.\r\n- Administrasi = Kop klinik surat ket sakit, kop klinik surat keterangan sehat, kop klinik form resep, form informed consent, kop klinik form rujukan.\r\n- R. Periksa = Bingkai uji coba lensa, plastik tempat sampah. \r\n- R. ASI = Setting prasarana di luar ASI, lemari es penyimpanan ASI.',	'Diperbaiki',	'PT. Phapros Tbk.',	'Manager EHS',	'629ef3271a502.png',	'Klinik_Pratama_Rawat_Jalan_PT_Phapros_Tbk_foto_klinik_1.png',	'629ef3271a591.png',	'629ef3271a5ff.png',	'629ef3271a675.png',	'629ef3271a6b5.png',	'',	'',	'',	'',	'2022-06-07 06:41:43',	'2022-06-07 06:41:43',	'0000-00-00 00:00:00',	0),
(17,	'TASK-PRTM08062022',	'PR002',	'Belum Memenuhi',	'- Kawasan tanpa rokok, APAR lt 1 belum ada, penamaan apotek diganti instalasi farmasi.\r\n- Ruang tindakan : tissu wastafel, tempat sampah medis & plastik blm ada, labeling obat emergency, benang otot, pelilit kapas, spekulum vagina, pispot.\r\n- Ruang periksa : bingkai uji coba lensa untuk refraksi otoscope\r\n- Administrasi : form rujukan, resep, surat ket sehat & sakit blm ada kop surat\r\n- Farmasi : display obat dihilangkan, etiket obat diganti klinik',	'Diperbaiki',	'Klinik Pratama Surya Medika',	'-',	'62a028be5ca4c.png',	'Klinik_Pratama_Rawat_Jalan_Surya_Medika_foto_klinik_1.png',	'62a028be5d4e3.png',	'62a028be5d559.png',	'62a028be5d5c3.png',	'62a028be5d630.png',	'',	'',	'',	'',	'2022-06-08 04:42:38',	'2022-06-08 04:42:38',	'0000-00-00 00:00:00',	0),
(18,	'TASK-PRTM08062022',	'PR003',	'Belum Memenuhi',	'- Papan nama klinik belum sesuai standar\r\n- Lemari RM : Kaca\r\n- Ruang tindakan : dexa inj, ambu bag, spekulum vagina, spekulum telimga\r\n- Ruang gigi : setting alat extraksi, pmeriksaan dasar\r\n- Ruang ASI : breast pump, petunjuk ruangan dipakai/tidak\r\n- Ruang periksa : bingkai uji coba lensa.\r\n- Daftar dokter di ruang tunggu\r\n- Administrasi ; Formulir rujukan, resep, ket sehat & sakit blm ada kop klinik\r\n- Ruang farmasi : etiket obat, SP, SIPNAP',	'Diperbaiki',	'dr. F . Enggar Sri Legani',	'dr. penanggung jawab',	'62a03b9408e9f.png',	'Klinik_Pratama_Rawat_Jalan_Bina_Medika_foto_klinik_1.png',	'62a03b9408f36.png',	'62a03b9408fa7.png',	'62a03b9409014.png',	'62a03b940904f.png',	'',	'',	'',	'',	'2022-06-08 06:03:00',	'2022-06-08 06:03:00',	'0000-00-00 00:00:00',	0),
(19,	'TASK-PRTM08062022',	'PR004',	'Belum Memenuhi',	'- Setting ulang R. Farmasi, R. Pendaftaran, R. Periksa umum.\r\n- Kaca lemari penyimpanan RM\r\n- Papan nama dokter di R. tunggu\r\n- R. tindakan : lemari alat, penataan label, troli emergency, spekulum hidung, telinga, vagina, cairan spiritus\r\n- Administrasi :  surat keterangan sehat & sakit blm ada kop klinik\r\n- R. Periksa : blm ada snellen chart, bingkai uji coba lensa, lup, otoscope\r\n- R. Asi : blm ada\r\n- R. Farmasi : penambahan TTK, pengadaan mell apotek (hrs pbf) termometer ruang, lemari es, tempat sampah, ruangan farmasi blm ada\r\n- Kawasan tanpa rokok',	'Diperbaiki',	'dr. Anggoro Dhana',	'Kepala Upt Poliklinik Udinus',	'62a13b40a785a.png',	'Klinik_Pratama_Rawat_Jalan_Dian_Nuswantoro_foto_klinik_1.png',	'62a13b40a97d6.png',	'62a13b40a984b.png',	'62a13b40a98b3.png',	'62a13b40a98ed.png',	'',	'',	'',	'',	'2022-06-09 00:13:52',	'2022-06-09 00:13:52',	'0000-00-00 00:00:00',	0),
(20,	'TASK-PRTM09062022',	'PR007',	'Belum Memenuhi',	'- Administrasi ; Formulir rujukan\r\n- Penamaan laboratorium dihilangkan dan pintu depan, jadwal praktik, meja pendaftaran, Formulir di klinik\r\n- Jadwal dokter di R. tunggu\r\n- R. Tindakan : pintu, meja kursi dipindah dari R. tindakan,cairan infus, spuite SCC, benang otot, jarum kulit, pinset ditambahkan, cairan spiritus, pispot, plester, alkohol, povidon ioidn, spekulum vagina, hidung, ambu bag.\r\n- R. Periksa belum sesuai standar (5m2), bingkai uji ciba lensa, snellen chart, otoscope\r\n- Petunjuk arah pelayanan lt. 2\r\n- R. ASI : Kulkas\r\n- Laboratorium : alat ukur suhu ruangan, kelembapan, lemari es',	'Diperbaiki',	'Klinik Pratama Helix',	'-',	'62a143c699627.png',	'Klinik_Pratama_Rawat_Jalan_Helix_foto_klinik_1.png',	'62a143c6996af.png',	'62a143c699716.png',	'62a143c699789.png',	'62a143c6997c3.png',	'',	'',	'',	'',	'2022-06-09 00:50:14',	'2022-06-09 00:50:14',	'0000-00-00 00:00:00',	0),
(21,	'TASK-PRTM09062022',	'PR005',	'Belum Memenuhi',	'- Papannama klinik diganti papan bukan MMT\r\n- R. Tindakan : stiker kaca dinding, tisu wastafel, spuite 1 cc, pispot\r\n- R. ASI : Breast pump\r\n- R. gigi : setting alat gigi.\r\n- R. Farmasi : Ruang konseling, surat pesanan (sipa baru)\r\n- Administrasi : alamat resep, informent consent, formulir rujukan, surat keterangan\r\n- R. Periksa : bingkai uji coba lensa untuk refraksi, buku ishihara, spekulu, hidung anak, bantal\r\n- Kawasan tanpa rokok belum ada labeling\r\n- Labeling R. Limbah B3 ',	'Diperbaiki',	'Umrizal',	'-',	'62a14e78beaf2.png',	'Klinik_Pratama_Rawat_Jalan_Dwi_Puspita_Pedurungan_foto_klinik_1.png',	'62a14e78beb6c.png',	'62a14e78bebcf.png',	'62a14e78bec37.png',	'62a14e78bec71.png',	'',	'',	'',	'',	'2022-06-09 01:35:52',	'2022-06-09 01:35:52',	'0000-00-00 00:00:00',	0),
(22,	'TASK-PRTM09062022',	'PR006',	'Belum Memenuhi',	'- R. ASI : kaca ruang ASImasih terlihat dari luar, lemari es belum ada\r\n- R. Tindakan : Perlatan minor set, jarum kulit, benang otot, Spuite 3cc, 5cc, pisau bedah, ambu bag, lidocain, setting alat tindakan, sterilisator dipindah ruang tindakan, povidon iodine, kapas, kassa\r\n- Administrasi : Surat keterangan sehat\r\n- Petunjuk arah pelayanan LT 2\r\n- Farmasi : administrasi SP, lemari navkotik, dispenser ',	'Diperbaiki',	'Lexa Skin Clinic',	'-',	'62a1ac3613fc9.png',	'Klinik_Utama_Rawat_Jalan_Lexa_foto_klinik_1.png',	'62a1ac361404e.png',	'62a1ac36140a6.png',	'62a1ac3614111.png',	'62a1ac361415d.png',	'62a1ac36141a8.png',	'62a1ac36141f5.png',	'',	'',	'2022-06-09 02:38:10',	'2022-06-09 08:15:50',	'0000-00-00 00:00:00',	0),
