(26,	'TASK-PRTM09082022',	'PR000010',	'Belum Memenuhi',	'- Ruang Periksa : belum ada bingkai uji coba lensa refraksi, pemindahan snellen chart\r\n- Ruang Laboratorium : disediakan ruang pengambilan sampel, SOP penyimpanan reagen dan pendistribusian reagen dari gudang obat\r\n- Farmasi : belum ada termometer kulkas & kartu monitoring suhu, buku pencatatan ED & penyimpanan obat di emergenct kit (masih tercampur satu dan lainnya)\r\n',	'Diperbaiki',	'Klinik Esti Husada',	'-',	'62f1e28871840.png',	'Klinik_Pratama_Esti_Husada_foto_klinik_1.png',	'62f1e28874100.png',	'62f1e288758a8.png',	'62f1e28875913.png',	'62f1e28875973.png',	'62f1e288759ae.png',	'62f1e288759d7.png',	'',	'',	'2022-08-09 04:28:56',	'2022-08-09 04:28:56',	'0000-00-00 00:00:00',	0),
(27,	'TASK-PRTM09082022',	'PR000011',	'Belum Memenuhi',	'- Petunjuk arah pelayanan lt 2\r\n- Penempatan APAR lt 1 di area publik\r\n- Labeling ruang penyerahan obat dan penerimaan resep\r\n- Administrasi klinik RM, informed consent\r\n- Ruang ASI : breast pump, lemari es\r\n- Ruang periksa : buku ishihara\r\n- Ruang tindakan :dexa inj, pispot spekulum vagina, spekulum hidung, cairan spiritus\r\n- Labeling runag perawatan\r\n- Jalur evakuasi belum ada\r\n- R. Informasi : daftar obat, buku pencatatan kadaluawarsa & narkotika\r\n- Penampungan limbah B3 sementara tertutup dan terkunci\r\n- SOP pengantaran linen kotor, screening pasien masuk (Pedulilindungi) \r\n- BA pemusnahan jarum ED',	'Diperbaiki',	'Klinik Mitavle Esthetic',	'-',	'62f21f5046683.png',	'Klinik_Pratama_Miracle_Aesthetic_Clinic_foto_klinik_1.png',	'62f21f5046717.png',	'62f21f5046780.png',	'62f21f50467e9.png',	'62f21f5046826.png',	'62f21f504685b.png',	'62f21f5046881.png',	'',	'',	'2022-08-09 08:48:16',	'2022-08-09 08:48:16',	'0000-00-00 00:00:00',	0),
