(30,	'TASK-PRTM09082022',	'PR000014',	'Belum Memenuhi',	'- R. Tindakan : sterilisator di R. RM, nirbaken, obat emergency, kapas, tempat sampah medis & non medis dg plastik, plester, jarum kulit, benang otot, scapal, spekulum hidung, spekulum telinga, spekulum vagina, ambubag, cairan infus RL, povidone iodine, cairan spiritus, pispot, pelilit kapas.\r\n- R. Periksa : wastafel di R. Periksa, snellen chart, tissu wastafel, bertekstur keras, lampu senter, palu refleks, meteran tb, stetoskop.\r\n- Administrasi : form surat ket sehat & sakit, form rujukan, form informed consent\r\n- R Asi : wastafel, tissu, lemari es, breast pump, meja\r\n- R Perawatan : botox, finfel\r\n- Petunjuk arah pelayan lt 2\r\n- Papan nama klinik\r\n- Alat sterill\r\n- R. konselling apoteker\r\n- Adrenallin inj',	'Diperbaiki',	'Ester D',	'SPV',	'62f324c89b404.png',	'Klinik_Utama_White_and_Young_Dermatology_Clinic_foto_klinik_1.png',	'62f324c89b49c.png',	'62f324c89b4ff.png',	'62f324c89b55c.png',	'62f324c89b5b3.png',	'62f324c89b5e8.png',	'62f324c89b61c.png',	'',	'',	'2022-08-10 03:23:52',	'2022-08-10 03:23:52',	'0000-00-00 00:00:00',	0),
